            }
            void AddLC2SASimpleObject (uint flags, int newmodelid, string dffpath, string txdpath)
            {
                var func = gameMode.Client.NativeLoader.Load("AddSimpleModel", new[] {
                    NativeParameterInfo.ForType(typeof(int)),
                    NativeParameterInfo.ForType(typeof(int)),
                    NativeParameterInfo.ForType(typeof(int)),
                    NativeParameterInfo.ForType(typeof(string)),
                    NativeParameterInfo.ForType(typeof(string)) }
                    );
                func.Invoke(0, FindModelIDForFlags(flags), newmodelid, dffpath, txdpath);
            }
